import React from "react";
import PropTypes from "prop-types";

function Ashley({ fav, picture, rating }) {
  return (
    <div>
      <h1>I love {fav}</h1>
      <h4>{rating}/5</h4>
      <img src={picture} alt={fav} />
    </div>
  );
  // Ashley(props)하고 return에서 I love props.fav해도 됨.
}

Ashley.propTypes = {
  fav: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,
};

const foodILike = [
  {
    id: 1,
    name: "kimchi",
    image:
      "data:image/jpeg;base64,",
    rating: 5,
  },
  {
    id: 2,
    name: "삼겹살",
    image:
      "data:image/jpeg;base64,",
    rating: 4,
  },
  {
    id: 3,
    name: "돈까스",
    image:
      "data:image/jpeg;base64,",
    rating: 4.9,
  },
];

function App() {
  return (
    <div>
      {foodILike.map((food) => (
        <Ashley
          key={food.id}
          fav={food.name}
          picture={food.image}
          rating={food.rating}
        />
      ))}
      {/* fav, picture = property or props, {food.name}, {food.image} = value */}
    </div>
  );
}

export default App;
